class Demo3b {

  paint(ctx, { width, height }, props) { // eslint-disable-line


    ctx.beginPath();
    ctx.moveTo(285, 155);
    ctx.lineTo(302, 159);
    ctx.lineTo(275, 247);
    ctx.lineTo(269, 245);
    ctx.lineTo(285, 165);
    ctx.fillStyle = '#191418';
    ctx.fill();

    ctx.beginPath();
    ctx.arc(268, 259, 9, 0, Math.PI * 2);
    ctx.fill();
  }
}
registerPaint('demo3b', Demo3b); // eslint-disable-line
